import React, { Component } from 'react';

class ReadData extends Component {
    static defaultProps = {
        data: {
            name: 'name',
            hospital: 'hospital',
            data: 'data',
        }
    }

    render() {
        const {
            name, hospital, data
        } = this.props.data;

        return (
          <div>
            <div>
              <b>{{name}}</b>
            </div>

          </div>
        );
    }
}

export default ReadData;
